import React, { useEffect, useState } from "react";
import axios from "axios";

function TravelBook() {
  const [travelBook, setTravelBook] = useState([]);
  const fetchData = async () => {
    const { data } = await axios.get("http://localhost:5000/api/travel");
    setTravelBook(data.travels);
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <>
      {travelBook.map((travel) => (
        <div className="card mb-3 mt-3">
          <img
            src="https://media.tacdn.com/media/attractions-splice-spp-674x446/07/03/1c/9c.jpg"
            className="card-img-top"
            alt="..."
          />
          <div className="card-body">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">
              This is a wider card with supporting text below as a natural
              lead-in to additional content. This content is a little bit
              longer.
            </p>
            <p className="card-text">
              <small className="text-body-secondary">
                Last updated 3 mins ago
              </small>
            </p>
          </div>
        </div>
      ))}
    </>
  );
}

export default TravelBook;
